text=""
k=11
dicta={}
for i in range(len(text)-k):
  dicta[text[i:i+k]]=""
for i in range(len(text)-k):
  if(dicta[text[i:i+k]]!=""):
    dicta[text[i:i+k]]+=","+text[i+1:i+k+1]
  else:
    dicta[text[i:i+k]]+=text[i+1:i+k+1]
mykes=list(dicta.keys())
mykes.sort()
dicta={i:dicta[i] for i in mykes}
for k in dicta.items():
  print(k[0]+" -> "+k[1])
